</SCRIPT><TABLE width="80%" align="center"><TR><TD align="left"><DIV class="dictionary"><H1><a href="filler" title="[21987] 6 ">filler</a></H1><SPAN><p><b>FILL'ER,</b> n.  <p><DD>1.  One who fills; one whose employment is to fill vessels.<p><DD>They have six diggers to four fillers, so as to keep the fillers always at work.<p><DD>2.  That which fills any space.<p><DD>3.  One that supplies abundantly.</SPAN></DIV></TD></TR></TABLE><HR /><BR /><BR /><BR /><BR /><BR ><BR /><BR /><BR /><BR /><BR >
